Tugjobs - Maxi Booty - Maxi Booty tugs it for fun

Added: Monday January 10, 2011

So I found my pal Mojito getting a tan in the parking lot of our studios. Who does that? I was about to ask, when I saw Maxi hanging out under the shade not to far away. So I went to go talk to her. She was chilling out enjoying her last day in Miami before she had to go back to Colorado. So I told her how about one little bit of fun before she goes. She knew what I was talking about and I didn't need to do much convincing. I told her to give Mojito a tug job in our parking lot because that sounds a lot more fun than getting a tan..don't you think?
